// Import
import React from "react";

// Functional Component
const AboutUs = () => {
    return(
        <div className="about-container">
            <h1 id="about-title">About Us</h1>
            <p id="about-text">Welcome to Car Haven, the premier destination for luxury car enthusiasts. Our dealership boasts an unparalleled selection of the world's most sought-after vehicles, from sleek and stylish sports cars to opulent and spacious SUVs.</p>
            <p id="about-text">At Car Haven, we are dedicated to providing our customers with a truly exceptional car-buying experience. Our knowledgeable and friendly sales staff is on hand to assist you with every aspect of your purchase, from selecting the perfect vehicle to arranging financing and customization options.</p>
            <p id="about-text">We understand that purchasing a luxury vehicle is a significant investment, and that's why we take the utmost care in ensuring that every vehicle in our inventory is of the highest quality. All of our cars undergo a rigorous inspection and reconditioning process before they are made available for sale, so you can rest assured that your new car will be in pristine condition.</p>
            <p id="about-text">In addition to our impressive selection of cars, we also offer a range of other services to make your car-buying experience as seamless and enjoyable as possible. From our state-of-the-art service center to our luxurious showroom and lounge, we have everything you need to make your dream car a reality.</p>
            <p id="about-text">Come visit us at Car Haven and experience the ultimate in luxury car buying. Whether you're in the market for your first luxury car or adding to your collection, we have the perfect vehicle for you.</p>
        </div>
    )
};

// Export
export default AboutUs;

// Rememeber IDs(#) are more specific than Classes(.)
